Unfortunately, I could not specify the purpose of my visit on your web site and therefore I had to wait for the doctor's schedule to be adjusted as my appointment is for an OMT treatment which takes 40 minutes.,Very kind and caring. Listened closely and asked follo up questions. ,Dr. George was very thorough and spent an ample amount of time evaluating my medical problem. His explanations and in his evaluation was easily understood. I am looking forward to further being treated by Dr. George.,Scheduling the 8 am appointment assured a short wait time, and individed attention from the staff, as the everyday problems which sometimes interfere had not arisen yet.,Dr. Winson George has been our family doctor for the past 6 years. And we are very happy being in his care. My son is an anxious guy with some special needs, so having Dr. George on our "team" of professionals has been a godsend to us! Thank you!! K.A.R.,Dr George and his staff were awesome! He's understanding and sincerely cares for his patient...your not just another appointment.  My daughter worked with him at Bryn Mawr Hospital and highly recommended him to me and I highly recommend him to all.,Dr George was very knowledgeable and described things in an easy to understand fashion. ,Amazing doctor with a kind, compassionate bedside manner. ,Winson George was very polite and listened to my needs. He was not judgmental in any way and was very in tune with the actual appointment instead of making me feel rushed to leave. Highly recommend him!!!,Dr. Winson George is an outstanding individual. Thank you!,Would like to continue the relationship with Dr George. You can tell he is concerned for his clients well being,Very thorough with lots of questions and recommendations.
